INSERT INTO `cadastros_documentos` (`Documento_ID`, `Titulo`, `Texto_Documento`, `Cabecalho_Rodape`, `Slug_Modulo`, `Data_Cadastro`, `Usuario_Cadastro_ID`, `Situacao_ID`) VALUES
	(1, 'Proposta Projeto', '<p style="text-align: center;"><span style="color: #000000; font-size: 8pt;"><strong>PROPOSTA - [id]&nbsp;</strong></span></p>\r\n<p><span style="color: #000000; font-size: 8pt;"><strong><br />1. CLIENTE</strong></span><br /><span style="color: #000000; font-size: 8pt;"><strong>1.1. Empresa:</strong>&nbsp;[solicitante-nome]</span><br /><span style="color: #000000; font-size: 8pt;"><strong>1.2. Telefone Contato:</strong> [solicitante-telefones]</span><br /><span style="color: #000000; font-size: 8pt;"><strong>1.3. E-mail do contato respons&aacute;vel:</strong>&nbsp;[solicitante-email]&nbsp;<br /><br /><strong>2. REPRESENTANTE:&nbsp;</strong><br /><strong>2.1. Nome:&nbsp;</strong>[vendedor-nome]<br /><strong>2.2. Telefone:&nbsp;</strong>[vendedor-telefones]<br /><strong>2.3. Email:&nbsp;</strong>[vendedor-email]<br /><br /></span><span style="color: #000000; font-size: 8pt;"><strong>3. PROJETO</strong></span><br /><span style="color: #000000; font-size: 8pt;"><strong>3.1. Descri&ccedil;&atilde;o Projeto</strong></span><br /><span style="color: #000000; font-size: 8pt;">O presente documento tem como objetivo descrever proposta para implanta&ccedil;&atilde;o.<br /></span><br />[produtos-listagem-completa-impostos]<br /><br /><span style="color: #000000; font-size: 8pt;"><strong>3.2. REPASSE DO CONHECIMENTO</strong></span><br /><span style="color: #000000; font-size: 8pt;">3.2.1. O repasse de conhecimento ser&aacute; realizado nas depend&ecirc;ncias da empresa contratada em hor&aacute;rio comercial sem custos. Caso seja necess&aacute;rio realiza&ccedil;&atilde;o de treinamento externo ou fora do hor&aacute;rio comercial ser&aacute; cobrado valor adicional.</span></p>\r\n<p><span style="color: #000000; font-size: 8pt;"><strong>4. &Acirc;MBITO DE INTERVEN&Ccedil;&Atilde;O DO CLIENTE</strong></span><br /><span style="color: #000000; font-size: 8pt;">4.1. Forma&ccedil;&atilde;o de um interlocutor que servir&aacute; como respons&aacute;vel por aprova&ccedil;&otilde;es e decis&otilde;es durante os projetos;</span></p>\r\n<p><span style="color: #000000; font-size: 8pt;"><strong>5. &Acirc;MBITO DE INTERVEN&Ccedil;&Atilde;O DA CONTRATADA</strong></span><br /><span style="color: #000000; font-size: 8pt;">5.1. Prestar os servi&ccedil;os que s&atilde;o objetos da presente proposta, com a compet&ecirc;ncia e a dilig&ecirc;ncia adequadas ao cumprimento desta, defendendo os leg&iacute;timos interesses e expectativas do cliente;</span><br /><span style="color: #000000; font-size: 8pt;">5.2. Comunicar ao cliente, ap&oacute;s a respectiva verifica&ccedil;&atilde;o, qualquer circunst&acirc;ncia que possa condicionar ou regular o desenvolvimentos do projetos;</span><br /><span style="color: #000000; font-size: 8pt;">5.3. N&atilde;o divulgar ou comunicar a terceiros, sem expresso consentimento do cliente, qualquer informa&ccedil;&atilde;o recebida, bem como elementos gr&aacute;ficos ou estudos relacionados com o projeto.&nbsp;</span></p>\r\n<p><span style="color: #000000; font-size: 8pt;"><strong>6. INFORMA&Ccedil;&Otilde;ES GERAIS</strong></span><br /><span style="color: #000000; font-size: 8pt;">6.1. Ser&aacute; considerado o in&iacute;cio do projeto quando forem confirmados: o pagamento inicial ou total do projeto.&nbsp;</span></p>\r\n<p><span style="color: #000000; font-size: 8pt;"><strong>7. INVESTIMENTO E FORMA DE PAGAMENTO</strong></span></p>\r\n<p><span style="font-size: 8pt;">a combinar</span></p>\r\n<p><span style="color: #000000; font-size: 8pt;"><strong>8. VALIDADE DA PROPOSTA</strong></span><br /><span style="color: #000000; font-size: 8pt;">30 dias.</span></p>\r\n<p><span style="color: #000000; font-size: 8pt;">Na expectativa de estar oferecendo a melhor oferta para os servi&ccedil;os solicitados,</span></p>\r\n<p><br /><span style="color: #000000; font-size: 8pt;">Atenciosamente</span></p>', 'CR', 'orcamentos', '2016-01-29 12:30:25', NULL, 1),
	(2, 'Proposta Renovação', '<p style="text-align: center;"><span style="color: #000000; font-size: 8pt;"><strong>PROPOSTA - [id]</strong></span></p>\r\n<p><span style="color: #000000; font-size: 8pt;"><strong>1. CLIENTE</strong></span><br /><span style="color: #000000; font-size: 8pt;"><strong>1.1. Empresa:</strong>&nbsp;[solicitante-nome]</span><br /><span style="color: #000000; font-size: 8pt;"><strong>1.2. Telefone Contato:</strong> [solicitante-telefones]</span><br /><span style="color: #000000; font-size: 8pt;"><strong>1.3. E-mail do contato respons&aacute;vel:</strong>&nbsp;[solicitante-email]&nbsp;<br /><br /><strong>2. REPRESENTANTE:&nbsp;</strong><br /><strong>2.1. Nome:&nbsp;</strong>[vendedor-nome]<br /><strong>2.2. Telefone:&nbsp;</strong>[vendedor-telefones]<br /><strong>2.3. Email:&nbsp;</strong>[vendedor-email]<br /><br /></span><span style="color: #000000; font-size: 8pt;"><strong>3. RENOVA&Ccedil;&Atilde;O</strong></span></p>\r\n<p><br /><span style="color: #000000; font-size: 8pt;"><strong>3.1. Descri&ccedil;&atilde;o</strong></span><br /><span style="color: #000000; font-size: 8pt;">O presente documento tem como objetivo descrever proposta para renova&ccedil;&atilde;o.<br /></span><br />[produtos-listagem-completa-impostos]<br />&nbsp;</p>\r\n<p><span style="color: #000000; font-size: 8pt;"><strong>4. INVESTIMENTO E FORMA DE PAGAMENTO</strong></span></p>\r\n<p><span style="font-size: 8pt;">a combinar</span></p>\r\n<p><span style="color: #000000; font-size: 8pt;"><strong>5. VALIDADE DA PROPOSTA</strong></span></p>\r\n<p><span style="color: #000000; font-size: 8pt;">7&nbsp;dias.</span></p>\r\n<p><span style="color: #000000; font-size: 8pt;">Na expectativa de estar oferecendo a melhor oferta para os servi&ccedil;os solicitados,</span></p>\r\n<p><br /><span style="color: #000000; font-size: 8pt;">Atenciosamente</span></p>', 'CR', 'orcamentos', '2016-03-07 11:23:19', NULL, 1),
	(3, 'Proposta Comercial', '<p style="text-align: left;"><span style="color: #000000; font-size: 8pt; font-family: tahoma;"><strong>PROPOSTA -[ano] [id]</strong></span></p>\r\n<p><span style="color: #000000; font-size: 8pt; font-family: tahoma;"><strong>CLIENTE</strong></span><br /><span style="color: #000000; font-size: 8pt; font-family: tahoma;"><strong>Empresa:</strong>&nbsp;[solicitante-nome]</span><br /><span style="color: #000000; font-size: 8pt; font-family: tahoma;"><strong>Telefone Contato:</strong> [solicitante-telefones]</span><br /><span style="font-size: 8pt; font-family: tahoma;"><span style="color: #000000;"><strong>E-mail do contato respons&aacute;vel:</strong>&nbsp;[solicitante-email]&nbsp;<br /><br /><strong>REPRESENTANTE:&nbsp;</strong><br /><strong>Nome:&nbsp;</strong>[vendedor-nome]<br /><strong>Telefone:&nbsp;</strong>[vendedor-telefones]<br /><strong>Email:&nbsp;</strong>[vendedor-email]<br /></span></span></p>\r\n<p><span style="color: #000000; font-size: 8pt; font-family: tahoma;"><strong>PROPOSTA COMERCIAL</strong></span><br /><span style="color: #000000; font-size: 8pt; font-family: tahoma;"><strong>Descri&ccedil;&atilde;o&nbsp;da Proposta</strong></span><br /><span style="color: #000000; font-size: 8pt; font-family: tahoma;">O presente documento tem como objetivo descrever proposta&nbsp;Comercial:<br /></span><br /><span style="font-size: 8pt; font-family: tahoma;">[produtos-listagem-completa-impostos]</span></p>\r\n<p><span style="color: #000000; font-size: 8pt; font-family: tahoma;"><strong>INVESTIMENTO E FORMA DE PAGAMENTO</strong></span></p>\r\n<p><span style="font-size: 8pt; font-family: tahoma;">a combinar</span></p>\r\n<p><span style="color: #000000; font-size: 8pt; font-family: tahoma;"><strong>VALIDADE DA PROPOSTA</strong></span></p>\r\n<p><span style="font-size: 8pt; font-family: tahoma;">7 dias</span></p>\r\n<p><span style="color: #000000; font-size: 8pt; font-family: tahoma;">Na expectativa de estar oferecendo a melhor oferta para os servi&ccedil;os solicitados,</span></p>\r\n<p><br /><span style="color: #000000; font-size: 8pt; font-family: tahoma;">Atenciosamente</span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', 'CR', 'orcamentos', '2016-03-11 18:01:44', NULL, 1),
	(4, 'Proposta Comercial - Modelo Anselmo', '<p>A SOFTWALL agradece a oportunidade de apresentar a proposta comercial para sua empresa.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Fundada em Fevereiro de 2009, a SOFTWALL surge com o objetivo de atender organiza&ccedil;&otilde;es de diversos segmentos e portes, entregando projetos de suporte em seguran&ccedil;a digital e servi&ccedil;os de infraestrutura de TI.&nbsp;</p>\r\n<p>Solu&ccedil;&otilde;es:</p>\r\n<p>Possu&iacute;mos um conjunto abrangente de solu&ccedil;&otilde;es de seguran&ccedil;a para web, email, endpoints, data centers, dados e rede.&nbsp;</p>\r\n<p>Clientes:</p>\r\n<p><img src="Z:MAKETING2014LogosEmpresasAker.png" alt="" /></p>\r\n<p>&nbsp;</p>', 'CR', 'orcamentos', '2016-03-17 16:30:05', NULL, 1);
