dil;&Otilde;ES GERAIS</strong></span><br /><span style="color: #000000; font-size: 8pt;">6.1. Ser&aacute; considerado o in&iacute;cio do projeto quando forem confirmados: o pagamento inicial ou total do projeto.&nbsp;</span></p> <p><span style="color: #000000; font-size: 8pt;"><strong>7. INVESTIMENTO E FORMA DE PAGAMENTO</strong></span><br /><br /><span style="color: #000000; font-size: 8pt;"><strong>8. VALIDADE DA PROPOSTA</strong></span><br /><span style="color: #000000; font-size: 8pt;">30 dias.</span></p> <p><span style="color: #000000; font-size: 8pt;">Na expectativa de estar oferecendo a melhor oferta para os servi&ccedil;os solicitados,</span><br /><span style="color: #000000; font-size: 8pt;">Atenciosamente</span></p>', 3, '2016-02-18 22:50:03', -1),
